Newstead Wood School Students Take Pride In Excellent GCSE Results
Students at Newstead Wood School are celebrating outstanding GCSE results today.
31% of grades were awarded the new top grade 9 and 86% of grades were achieved 9-7/A* - A grades.
Notable successes include:
Shrinidhi Prakash, who received 10 9’s and an A* with distinction in Level 2 Further Mathematics;
Naomi Felix, who received 10 9’s and an A* with distinction in Level 2 Further Mathematics;
Laura Diprose, who received 10 9’s and an A* in Level 2 Further Mathematics;
Sarah El-Toukhy, who received 10 9’s and an A* in Level 2 Further Mathematics;
Lauren Walker, who received 10 9’s;
Raya Milushev, who received 9 9’s and an A* in Level 2 Further Mathematics;
Ciara McPherson, who received 9 9’s and an A* with distinction in Level 2 Further Mathematics and an A* in Chinese;
Lily Wright, who received 9 9’s and an A* with distinction in Level 2 Further Mathematics
Aditi Pandiri, who received 9 9’s and an A* in Level 2 Further Mathematics
Sanjana Chanda, who received 9 9’s, an A* with distinction in Level 2 Further Mathematics and two further A*’s;
Shruti Cotra, who received 9 9’s, an A* with distinction in Level 2 Further Mathematics and an further A*; 
Peheli Lekamwattage, who received 9 9’s, an A* in Level 2 Further Mathematics and an further A*; 
Zarya Mekathotti, who received 9 9’s, an A* with distinction in Level 2 Further Mathematics and an further A*; 
Anujah Mohanathan, who received 9 9’s, an A* with distinction in Level 2 Further Mathematics and an further A*; 
Stephanie Olujinmi-Raji, who received 9 9’s, an A* with distinction in Level 2 Further Mathematics and an further A*; 
In total, our students received 513 new grade 9’s and 128 A* or A* with distinction.
Alan Blount, Headmaster of Newstead Wood School, said:
“It is an immensely proud day for the whole Newstead Wood School community. I would like to extend my congratulations to all students and their families on these outstanding results. I am delighted with the GCSE performance this year and I look forward to seeing all students in September as they begin their A Level studies.”
